func Test_firstUniqChar(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want byte
	}{
		{
			name: "Simple",
			args: args{"abaccdeff"},
			want: byte('b'),
		},
		{
			name: "Simple",
			args: args{""},
			want: ' ',
		},
		{
			name: "LeetCode",
			args: args{""},
			want: byte('y'),
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := firstUniqChar(tt.args.s); got != tt.want {
				t.Errorf("firstUniqChar() = %v, want %v", got, tt.want)
			}
		})
	}
}
